Pirmojo kėlinio pradžioje vyko lygi ir atkakli kova, o pirmaujanti komanda keitėsi net kelis kartus. Įpusėjus pirmajai rungtynių daliai rezultatas tarp ekipų dar buvo lygus (7:7), tačiau tuomet svečiai iš Kauno pagerino savąją gynybą ir perėmė rungtynių iniciatyvą. Nors per pirmas 30 minučių „Granitui – Kariui“ solidaus pranašumo susikurti nepavyko, tačiau ilsėtis jie išėjo pirmaudami 14:16. Po pertraukos kauniečiai išėjo dar labiau užsivedę – puikiai vartuose darbavosi Lukas Gurskis, o puolant visas problemas sprendė Vaido Drevinsko ir Mindaugo Urbono tandemas. Likus iki susitikimo pabaigos 15 minučių „Granitas – Karys“ jau pirmavo 23:29. Nors per likusį laiką šeimininkai dar bandė gelbėtis ir inicijavo kelis spurtus, tačiau priartėti arčiau nei per keturis įvarčius jiems nebepavyko. „Granitas – Karys“ Klaipėdoje šventė pergalę rezultatu 35:40 ir liko vienintele ekipa visoje lygoje dar nepatyrusia pralaimėjimo. Lukas Gurskis („Granitas-Karys“):  „Rezultatas geras – laimėjome, pasiekėme tai, ko norėjome. Atvažiavome susikaupę, klausėme, ką sakė treneris, matote – rezultatas yra. Stiprioji pusė buvo komandos draugiškumas, aikštelėje kovojome vienas už kitą, tai darome ir už aikštelės ribų. Niekada negalima savo pasirodymo vertinti labai gerai, tiesiog padėjau komandai kiek reikėjo.“ Artūras Juškėnas („Dragūno“ vyr. treneris):  „Nedažnai didysis kombinatorius patiria tokių nusivylimų, bet, matyt, tai gerai – džiaugsmas nekūrybingas, kūrybinga kančia. Vienareikšmiškai šiandien mes neįvertinome varžovo. Buvo iš mano lūpų pasakyti žodžiai, kad mes turime įmesti 40 įvarčių ir ar yra komanda, kuri gali mus įveikti. Štai, yra. Pagarba „Granitui“ – klubas eilinį kartą įrodė, kad didi istorija persiduoda. Šiuo metu Kauno klubas yra tikrai geros formos ir parodė, kaip reikia žaisti rankinį.“ (function(d, s, i, r) {
